import React from "react";
import "./App.css";
import { Link } from "react-router-dom";

function Nav() {
  return (
    <nav>
      <h3>Logo</h3>
      <ul className="nav-links">
        <Link to="/random">
          <li>random</li>
        </Link>
        <Link to="/search">
          <li>search</li>
        </Link>
        <Link to="/about">
          <li>about</li>
        </Link>
      </ul>
    </nav>
  );
}

export default Nav;
